import {
    SELECT_ROCKET
  } from '../types';

const rocket = (state = {
    rocketId: "",
  }, action) => {
    switch (action.type) {
      case SELECT_ROCKET: {
        return {
          ...state,
          rocketId: action.rocket,
        }
      }
    default:
        return state;
    }
}

export default rocket;
